css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("woolworthsonline.com.au") {


.quantity-input, input,
.add-to-trolly-button, #body-footer,
.view-options-container,
#footer-panel, #header-panel
{
background: #000000 !important;
}
#content-container,
#root li, .expanded-navigation li,
.middle, #search, .search-box-layout,
.trolley-heading, .ui-autocomplete
{
background: #333333 !important;
}
body, .product-stamp-middle,
#root li .navigation-label:hover,
.expanded-navigation .navigation-label:hover,
#body-container
{
background: #111111 !important;
}
#footer-panel a:hover
{
text-decoration: underline !important;
}
#root li a, .trolley-total, label, .quantity-input,
.trolley-count, .description, .you-might-like-header,
.price, .cup-price, input, .expanded-navigation li a,
.view-type a, .shop-info-address, .search-content h1,
.time-slot a, .store-name a, .navigation-hint,
.collect-text, #footer-panel a, .ui-autocomplete a,
.paging-description, .items-per-page,
.special-text-tag a, .special-text-tag span,
.change-delivery-container a
{
color: #FFFFFF !important;
}
}
